import React, {Component} from "react";

export default class Register extends Component {
    constructor(props: Readonly<{}>) {
        super(props);
        this.state = {items:[]};
    }
    componentDidMount() {

        fetch('api/customer/')
            .then(response => response.json())
            .then(data => this.setState({item: data}));
    }

    render() {
        return (<div className='home-wrap'>
            {this.state}
        </div>)
    }
}
